import { createSlice } from "@reduxjs/toolkit";

const initialState =  {
    data: [],
    status: "idle",
    error: null,
  }
const geoSlice = createSlice({
    name: 'data',
    initialState,
    reducers: {
      setGeo: (state, {payload}) => {
        state.status = 'idle'

    }
    },
    extraReducers: 
      {


      }
  });
  export const {
    setGeo
} = geoSlice.actions;  
  export default geoSlice.reducer;
